import React from 'react'
const G_LOGO = '../../../assets/googleIcon.svg';

const GAuth = () => {
  return (
    <div>
        <img style="../../../assets/googleIcon.svg" src={G_LOGO} alt="googleLogo" />
    </div>
  )
}

export default GAuth
